import React, {Component} from 'react';

class ConstructionPage extends Component {
    render() {
        return (
            <div>
                <div className="container">
                    <p>Thi công hoàn thiện nội thất là một công việc đòi hỏi sự am hiểu tổng quát về vật liệu hoàn thiện, trang thiết bị, đặc tính và cách thức thi công của từng hạng mục. Mỗi một công trình sẽ có rất nhiều hạng mục cần thi công hoàn thiện nội thất như : xây lại tường ngăn, ốp lát gạch, lắp đặt hoặc bổ sung đường dây điện, đường ống cấp thoát nước, đường ống ga cho máy điều hòa, lắp đặt hệ trần treo trang trí, sơn tường, lát sàn gỗ, lắp dụng vách, cửa kính, đóng đồ gỗ, lắp hệ thống đèn chiếu sáng … và rất nhiều công việc đòi hỏi sự tỉ mỉ khác nữa.</p>
                </div>
            </div>
        );
    }
}

export default ConstructionPage;
